(1540, 1855, 'event', '2', '{\"event_id\":2,\"event_name\":\"International Webinars and workshop on Javanese Culture\",\"event_client\":\"Keraton Ngayogyakarta\",\"event_address\":\"Jl. Pandega Siwi, Caturtunggal, Kec. Depok, Kabupaten Sleman, Daerah Istimewa Yogyakarta 55281, Indonesia\",\"event_desc\":\"The Palace of Yogyakarta, as the center of Javanese Culture, has been continuously preserving various forms of Javanese cultural expression passed down from its ancestors. The palace ensures that the richness of Javanese culture reaches a wider audience across generations.\\n\\nSince 2019, The Palace of Yogyakarta has been hosting international symposiums on Javanese culture. The event is held alongside the anniversary of the accession to the throne (Tingalan Jumenengan Dalem) of Sri Sultan Hamengkubuwono X, which occurs every March 7. Amidst the pandemic situation, The Palace of Yogyakarta will hold “International Webinar & Workshop on Javanese Culture”. The event welcomes international academia to share their thoughts via four webinars. In addition to that, there will be online workshops that accommodate participants to learn handicraft and Javanese cuisines cooking technique. All events will be held for two hours every weekend in July 2021.\\n\\nInternational webinar and workshop on Javanese culture that will be held in July 2021 is expected to coincide with summer break in few regions. It is hoped that Javanese communities, not only in Indonesia, but also in countries like The Netherlands, Suriname, Malaysia, Singapore, New Caledonia and beyond will be able to participate in. Within these communities, we can see some similarities in their cultural expression, such as traditions or habits, language, performing arts, as well as philosophies. Scholarly dialogues, workshops, discussions, and any other academic based events are needed to keep the values and appreciation towards Javanese culture well maintained. These activities have become possible to actualize during this pandemic with the support of technology.\",\"event_image\":\"4be71c9c-776c-4ff2-8fdf-d04389902ec4\",\"event_date_start\":\"2021-10-09\",\"event_date_finished\":\"2021-10-10\"}', '{\"event_date_start\":\"2021-10-10\",\"event_date_finished\":\"2021-10-11\"}', NULL),
