(1552, 1870, 'event', '1', '{\"event_id\":1,\"event_name\":\"Dream World Wide in Jogja\",\"event_client\":\"Lumintu Logic\",\"event_address\":\"Gang, Jalan Candirejo, Jl. Pandega Siwi No.6A, Manggung, Caturtunggal, Depok Sub-District, Sleman Regency, Special Region of Yogyakarta 55281\",\"event_desc\":\"Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \\\"de Finibus Bonorum et Malorum\\\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \\\"Lorem ipsum dolor sit amet..\\\", comes from a line in section 1.10.32.\",\"event_image\":\"b3574d2f-2c93-4a75-b7ea-832ea6ed9860\",\"event_date_start\":\"2021-10-02\",\"event_date_finished\":\"2021-10-04\"}', '{\"event_image\":\"b3574d2f-2c93-4a75-b7ea-832ea6ed9860\"}', NULL),
